(2315, 33, 361, 2, 'If I See the Devil', '', '2008-04-24 00:00:00', 0000, 10, 0, 7, 'If I see the devil 怎能停止被剝奪\r\nIf I see the devil 你在夜裡受折磨\r\n                                                                                \r\n為了你純潔完美無瑕 我承受一切沙漠的風暴\r\n就這麼吹蝕風化殆盡 卻無法再為你繼續承擔遮蔽\r\n                                                                                \r\nAnd I dream the nightmare 我瘋狂用力追逐著\r\nAnd I dream the nightmare 你沒命痛苦哀嚎著\r\n                                                                                \r\n我一轉身回頭就被   紅色的傷心平原所淹沒\r\n在那裡吶喊狂叫無助 無聲尖叫撕裂希望\r\n                                                                                \r\n別再奪走我一切 讓我體無完膚還不夠\r\n不要踐踏我的心 我的尊嚴我的真愛   \r\n                                                                                \r\nIf I see the dark night 睜開眼以為醒來\r\nIf I see the dark night 原來噩夢離不開\r\n                                                                                \r\n我一轉身回頭就被   紅色的傷心平原所淹沒\r\n在那裡吶喊狂叫無助 無聲尖叫撕裂希望\r\n                                                                                \r\n別再奪走我一切 讓我體無完膚還不夠\r\n不要踐踏我的心 我的尊嚴我的真愛   \r\n\r\n拖著千瘡百孔的身體\r\n我殘廢了  但前進著\r\n(我前進著  前進著)\r\n                                                                                \r\n在他眼中沒有憐憫 在我面前只剩空氣\r\n最初的你要去哪裡 你我倆相依為命\r\n', '', 0, '', 'Twice a Week', 'Twice a Week', 'Twice a Week', 'Twice a Week', '', 0, 0, 1, '2008-04-24 10:49:20', '2013-10-07 17:11:52', '0000-00-00 00:00:00'),
(2316, 33, 361, 3, '新世紀冒險家', '', '2008-04-24 00:00:00', 0000, 0, 1, 7, '新世紀的冒險家    浮游在藍色水族箱\r\n嘴巴還含著棒棒糖  卻忘記童年的模樣\r\n                                                                                \r\n把戰鬥裝備穿上  操控我的鐵金剛\r\n拯救地球我來啦\r\n                                                                                \r\n別被遺棄 我就必須 調皮搗蛋 拼命製造麻煩\r\n需要憐愛 我就還在 黑名單上 被紅筆圈起來\r\n                                                                                \r\n舊時代溫室花瓣 飄落在肺泡末端\r\n在氣管裝模作樣 卻忘記枯萎的黯淡\r\n                                                                                \r\n把戰鬥裝備穿上  操控我的鐵金剛\r\n拯救地球我來啦\r\n                                                                                \r\n別被遺棄 我就必須 調皮搗蛋 拼命製造麻煩\r\n需要憐愛 我就還在 黑名單上 被紅筆圈起來\r\n                                                                                \r\n為什麼媽媽不來接我 我可是全世界的英雄\r\n為什麼媽媽不來接我 我可是全世界的英雄\r\n                                                                                \r\n別被遺棄 我就必須...\r\n需要憐愛 我就還在...\r\n\r\nI have no choice so I have to..', '', 0, '', 'Twice a Week', 'Twice a Week', 'Twice a Week', 'Twice a Week', '', 0, 0, 1, '2008-04-24 10:53:11', '2013-10-07 17:11:52', '0000-00-00 00:00:00'),
(2317, 33, 361, 4, '一個人的生活', '', '2008-04-24 00:00:00', 0000, 10, 0, 8, '你迎接的 是甚麼夜晚\r\n空蕩蕩的床鋪 還少了點溫度\r\n\r\n我總是無法跟上你感受的影子\r\n我總是無法融入你纖細的樣子\r\n\r\n你期待的 是甚麼早晨\r\n細雨綿綿的天氣 和溼答答的帆布鞋\r\n\r\n你用甚麼 顏色粉刷\r\n要我別走的黑夜\r\n熟睡的你在床上而我悄悄離開\r\n\r\n我總是無法跟上你感受的影子\r\n我總是無法融入你纖細的樣子\r\n\r\n不該讓你一個人\r\n一個人的生活著\r\n在這個灰色的世界裡 用盡顏料', '', 0, '', 'Twice a Week', 'Twice a Week', 'Twice a Week', 'Twice a Week', '', 0, 0, 1, '2008-04-24 10:59:03', '2013-10-07 17:11:52', '0000-00-00 00:00:00'),
