(2362, 1024, 0, 1, '好眼淚壞眼淚（鋼琴版）', '一個同事（葉子）\r\n喜歡許愇倫、懷念她的聲音\r\n藉由這優美的鋼琴聲可以回想她甜美的聲音、臉孔。\r\n希望（葉子）有感受到！', '0000-00-00 00:00:00', 0000, 15, 2, 7, '§ 好眼淚壞眼淚 §\r\n作詞：嚴云農　作曲：伍仲衡\r\n\r\n我曾　認真　深愛著一個人　他給我幸福的可能\r\n我等　我問　未來何時發生　他只是給我一個吻\r\n\r\n快樂　我哭　是因為你的手　曾答應帶我向前走\r\n難過　我哭　是因為我的手　找不到你說的以後\r\n\r\n好眼淚　壞眼淚　我都曾為你流　感動和悲傷都是理由\r\n只不過　在你不再愛我了以後　剩壞的眼淚慢慢流\r\n\r\n快樂　我哭　是因為我付出　得到你溫柔的答覆\r\n難過　我哭　是因為我認輸　你的心永遠留不住\r\n\r\n好眼淚　壞眼淚　我都曾為你流　感動和悲傷都是理由\r\n只希望　在我不再想你了之後　有好的眼淚慢慢流\r\n\r\n好眼淚　壞眼淚　我都曾為你流　感動和悲傷都是理由\r\n只希望　在我不再想你了之後　有好的眼淚慢慢流\r\n\r\n有好的笑容陪著我', '', 0, '', 'Axl', '', 'Axl', '', '', 0, 0, 1, '2008-04-25 16:17:34', '2013-10-07 17:11:52', '0000-00-00 00:00:00'),
